var rhAccountDropdown = (function () {

  // Get the component dom element and login/out urls
  var dropdownComponent = document.querySelector("rh-account-dropdown"),
      logInUrl = dropdownComponent.getAttribute("tmp-login-link") ? dropdownComponent.getAttribute("tmp-login-link") : "",
      logOutUrl = dropdownComponent.getAttribute("tmp-logout-link") ? dropdownComponent.getAttribute("tmp-logout-link") : "";

  function setComponentAttribute(attribute, value) {
    // Check for param and return if false
    if (attribute) {
      // Check value and if not present set to empty string
      var parsedValue = value ? value : "";
      // If there is no vlaue to set remove the attribute otherwise set it
      if(parsedValue === "") {
        dropdownComponent.removeAttribute(attribute);
      } else {
        dropdownComponent.setAttribute(attribute, parsedValue);
      }
    } else {
      return;
    }
  }

  return {
    hasDropdownComponent: function() {
      return dropdownComponent ? true : false;
    },
    getDropdownComponent: function(){
      return dropdownComponent;              
    },
    setLogInState: function() {
      setComponentAttribute("logout-link", "");
      setComponentAttribute("login-link", logInUrl);
    },
    setLogOutState: function(rhdUserData) {
      if (rhdUserData) {
        setComponentAttribute("login-link", "");
        setComponentAttribute("logout-link", logOutUrl);
        dropdownComponent.userData = rhdUserData;
      } else {
        setComponentAttribute("logout-link", "");
        setComponentAttribute("login-link", logInUrl);
      }
    } 
  };

})();;
